void PrintASN1PusTM_TC_Dummy_Data(const char *paramName, const asn1SccPusTM_TC_Dummy_Data *pData)
{
    (void)paramName;
    (void)pData;
#ifdef __linux__
    pthread_mutex_lock(&g_printing_mutex);
#endif
#ifdef __unix__
    //printf("%s PusTM-TC-Dummy-Data ::= ", paramName);
    printf("%s ", paramName);
    #if WORD_SIZE==8
    printf("%lld", (*pData));
    #else
    printf("%d", (*pData));
    #endif
#endif
#ifdef __linux__
    pthread_mutex_unlock(&g_printing_mutex);
#endif
}

void PrintASN1PusTmHeader(const char *paramName, const asn1SccPusTmHeader *pData)
{
    (void)paramName;
    (void)pData;
#ifdef __linux__
    pthread_mutex_lock(&g_printing_mutex);
#endif
#ifdef __unix__
    //printf("%s PusTmHeader ::= ", paramName);
    printf("%s ", paramName);
    printf("{");
    printf("pusVersion ");
    switch((*pData).pusVersion) {
    case 0:
        printf("pus-V0");
        break;
    case 1:
        printf("pus-V1");
        break;
    case 2:
        printf("pus-V2");
        break;
    case 15:
        printf("pus-INVALID-VERSION");
        break;
    default:
        printf("Invalid value in ENUMERATED ((*pData).pusVersion)");
    }
    printf(", ");
    printf("timeRefStatus ");
    #if WORD_SIZE==8
    printf("%lld", (*pData).timeRefStatus);
    #else
    printf("%d", (*pData).timeRefStatus);
    #endif
    printf(", ");
    printf("serviceId ");
    #if WORD_SIZE==8
    printf("%lld", (*pData).serviceId);
    #else
    printf("%d", (*pData).serviceId);
    #endif
    printf(", ");
    printf("subtypeId ");
    #if WORD_SIZE==8
    printf("%lld", (*pData).subtypeId);
    #else
    printf("%d", (*pData).subtypeId);
    #endif
    printf(", ");
    printf("msgTypeCount ");
    #if WORD_SIZE==8
    printf("%lld", (*pData).msgTypeCount);
    #else
    printf("%d", (*pData).msgTypeCount);
    #endif
    printf(", ");
    printf("destination ");
    #if WORD_SIZE==8
    printf("%lld", (*pData).destination);
    #else
    printf("%d", (*pData).destination);
    #endif
    printf(", ");
    printf("time ");
    printf("{");
    printf("tv-sec ");
    #if WORD_SIZE==8
    printf("%lld", (*pData).time.tv_sec);
    #else
    printf("%d", (*pData).time.tv_sec);
    #endif
    printf(", ");
    printf("tv-nsec ");
    #if WORD_SIZE==8
    printf("%lld", (*pData).time.tv_nsec);
    #else
    printf("%d", (*pData).time.tv_nsec);
    #endif
    printf("}");
    printf("}");
#endif
#ifdef __linux__
    pthread_mutex_unlock(&g_printing_mutex);
#endif
}

